('2359','2','8329','inmovisa',Null,'Neu renovierte Wohnung Nähe Rambla in Palma de Mallorca','33225','\r\nDiese Wohnung hat 135m² Wohnfläche plus 100m² Terrasse. Sie liegt im 5 OG und wurde neu renoviert. Es sind nur wenige Gehminuten zur Promenade  „La Rambla“ und zur Calle Olmos. Die Wohnung hat 3 Schlafzimmer, 2 Badezimmer, 1 Salon (40m²), moderne Küche mit Hauswirtschaftsraum und eine 100m² große Terrasse. \r\nZur Ausstattung gehören u.a Kirschbaum Türen, Dreifachverglasung, Klimaanlage w/k und vorinstallierte Zentralheizung. Ein Tiefgaragenplatz kann für 35.000€ optional dazu erworben werden. Die Wohnung wird ohne Möbel verkauft. \r\n','33226','604000','106','2015-08-06 11:59:17','106','2015-08-06 12:00:37',Null,'2441','105','1147',1,'1','0',Null,Null,Null,'33227',Null,'0','0','0',Null,'2015-08-06 12:07:28',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33228',Null,'33229',Null,'33230',Null,'33231','971 725969','33232','0',0,'5');
